    render() {
        return (
            <div className='productBox'>
                <div className='productImageBox'>
                    <Link> <img src={"https://cdn.shopify.com/s/files/1/0087/6193/3920/products/DD1381200_DEOA_2_720x.jpg?v=1612816087"} className='productImage' alt='product' /></Link>
                </div>
                <p className='productName'>Running Short</p>
                <p className='productPrice'>$50.00</p>
            </div>
        )
    }
}
